import { useParams, Route } from "react-router-dom";
const QuoteDetail = ()=>{
    const id = useParams();
    return (<div>
                <h1>QuoteDetails</h1>
                <h2>{id.quoteId}</h2>
                <Route path='//allquotes/:quoteId/comments'></Route>
            </div>)
}
export default QuoteDetail;
